syntax = "proto2";

package com.market;

option optimize_for = SPEED;
option java_package = "com.binance.ws.messages.protobuf.com.market";
option java_multiple_files = true;
option java_outer_classname = "GetAccountUserConfigReqProto";

message GetAccountUserConfigReq {
  optional string configType = 1;
  optional string exclude = 2;
  optional bool needLocalRecommend = 3;
}

